import './Header.css';
import { React, useContext, useEffect, useState } from 'react';
import AuthContext from '../../Context/AuthContext';
import Cookies from 'js-cookie';

const Header = () => {
  const { logout } = useContext(AuthContext);
  const [userAdmin, setUserAdmin] = useState(null);

  useEffect(() => {
    const fetchUser = async () => {
      const jwtToken = Cookies.get('jwt_token');
      const url = `${process.env.REACT_APP_API_URL}/api/auth/user`;
      const options = {
        headers: {
          Authorization: `Bearer ${jwtToken}`,
        },
        method: 'GET',
      };
      const response = await fetch(url, options);
      if (response.ok) {
        setUserAdmin(true);
      }
    };

    fetchUser();
  }, []);

  const logoUrl = 'https://i.postimg.cc/sxNqc8zX/pexels-sora-shimazaki-5673488.jpg'; // Path from the public directory

  return (
    <>
      <header className="header">
        <div className="logo">
          <img src={logoUrl} alt="Your Logo" style={{ height: '50px', width: 'auto' }} />
        </div>
        <nav className="nav-menu">
          <ul>
            <li><a href="/">Home</a></li>
            <li><a href="/">User Info</a></li>
            <li><a href="/about">About</a></li>
          </ul>
        </nav>
        <div className="nav-item dropdown">
          <a className=" nav-link " href="/" data-bs-toggle="dropdown" aria-expanded="false">
            <svg xmlns="http://www.w3.org/2000/svg" width="25" height="25" fill="currentColor" class="bi bi-menu-button-wide" viewBox="0 0 16 16">
              <path d="M0 1.5A1.5 1.5 0 0 1 1.5 0h13A1.5 1.5 0 0 1 16 1.5v2A1.5 1.5 0 0 1 14.5 5h-13A1.5 1.5 0 0 1 0 3.5zM1.5 1a.5.5 0 0 0-.5.5v2a.5.5 0 0 0 .5.5h13a.5.5 0 0 0 .5-.5v-2a.5.5 0 0 0-.5-.5z" />
              <path d="M2 2.5a.5.5 0 0 1 .5-.5h3a.5.5 0 0 1 0 1h-3a.5.5 0 0 1-.5-.5m10.823.323-.396-.396A.25.25 0 0 1 12.604 2h.792a.25.25 0 0 1 .177.427l-.396.396a.25.25 0 0 1-.354 0M0 8a2 2 0 0 1 2-2h12a2 2 0 0 1 2 2v5a2 2 0 0 1-2 2H2a2 2 0 0 1-2-2zm1 3v2a1 1 0 0 0 1 1h12a1 1 0 0 0 1-1v-2zm14-1V8a1 1 0 0 0-1-1H2a1 1 0 0 0-1 1v2zM2 8.5a.5.5 0 0 1 .5-.5h9a.5.5 0 0 1 0 1h-9a.5.5 0 0 1-.5-.5m0 4a.5.5 0 0 1 .5-.5h6a.5.5 0 0 1 0 1h-6a.5.5 0 0 1-.5-.5" />
            </svg>
          </a>
          <ul className="dropdown-menu">
            <li><a className="dropdown-item" href='/'>Home</a></li>
            <li><a className="dropdown-item" href='/' >Another action</a></li>
            <li><a className="dropdown-item" href='/'>Something else here</a></li>
          </ul>
        </div>
        {userAdmin && (
          <div className="btn-group">
            <button type="button" className="btn btn-primary dropdown-toggle" data-bs-toggle="dropdown" data-bs-display="static" aria-expanded="false">
              Admin Panel
            </button>
            <ul className="dropdown-menu dropdown-menu-end dropdown-menu-lg-start">
              <li><a className="dropdown-item" href="/employeecreate">Employee Create</a></li>
              <li><a className="dropdown-item" href="/employeeupdate">Employee Details Update</a></li>
              <li><a className="dropdown-item" href="/employeedelete">Employee Delete</a></li>
            </ul>
          </div>
        )}
        <button className="logout-btn" onClick={logout}>Logout</button>
      </header>
    </>
  );
};

export default Header;
